import React from 'react'

function SosialMedia(props) {
    return (
        <div className = 'team-sm-wrapper flex'>
        <div className = 'team-sm flex'>
            {props.sm.map(item => {
                return(
                    <a>
                        <img src = {item.img}   />
                        <h5></h5>
                    </a>

                )
            })} 
        </div>
        </div>
    )
}

export default SosialMedia
